COPY public.pages_faq (id, question, answer, "order", icon) FROM stdin;
1	How does AI help farmers?	Our AI analyzes soil, weather, and historical farming data to provide actionable insights, helping farmers **optimize yields, reduce waste, and make smarter decisions**.	0	🌱
2	How do I get started?	Simply enter your farm details (location, soil conditions, or crop type), and AI will generate **personalized insights** to guide your farming decisions.	0	📍
3	How accurate are the AI insights?	Our AI is trained on **extensive agricultural data** and integrates real-time weather updates. While highly accurate, external factors such as **unexpected climate changes** may impact predictions.	0	🎯
4	Do I need IoT sensors for AI insights?	No! Our AI system works **with or without IoT sensors** by analyzing **weather APIs, historical trends, and real-time climate data** to generate insights.	0	🚜
